import React from 'react'

function Banner() {
    return (
        <div className="banner">
            <div className="contact"><span>Liên hệ MAKEUP tại Đà Nẵng: 0123456789 (Ms.Hiền)</span></div>
        </div>
    )
}

export default Banner
